import React from "react";

function Main() {
	return (
		<d>
			<h1>Hello, My name is Venu</h1>
			<p>My hobbies are reading, playing, cooking, sketching</p>
			<ul>
				<li>Leh Ladakh</li>
				<li>Rameshwaram</li>
				<li>Goa</li>
			</ul>
		</d>
	);
}

export default Main;
